    private void init() {

        tableLayout = findViewById(R.id.game_table);
        btn_play_or_stop = findViewById(R.id.btn_game_playorstop);
        btn_home = findViewById(R.id.btn_game_go_main_menu);
        btn_save = findViewById(R.id.btn_game_save);
        fieldLifes = new FieldLifes(100, 99);
    }

    private View.OnClickListener listener = new View.OnClickListener() {
        @Override
        public void onClick(View v) {

            if (v.getTag().equals("plain")){
                v.setBackgroundColor(Color.GREEN);
                v.setTag("life");
                v = (ImageView) v;
                fieldLifes.getLifes().add(new Point((int)v.getTag(X),(int)v.getTag(Y)));



            }
            else{
                v.setBackgroundColor(Color.WHITE);
                v.setTag("plain");
                v.setBackgroundResource(R.drawable.node);
                v = (ImageView) v;
                fieldLifes.getLifes().remove(new Point((int)v.getTag(X),(int)v.getTag(Y)));
            }

        }
    };



    @SuppressLint("ClickableViewAccessibility")
    private void makeField(){

        for(int i = 0; i < 100; i++) {
            for(int j = 0  ; j < 99; j++) {
                fieldLifes.getImageField()[i][j] = ivs[i][j];
                fieldLifes.getImageField()[i][j].setTag(X,i);
                fieldLifes.getImageField()[i][j].setTag(Y,j);
                fieldLifes.getImageField()[i][j].setOnClickListener(listener);
                fieldLifes.getImageField()[i][j].setTag("plain");

            }
        }


    }

